import React from 'react';
import {MenuContainer, MenuBrick, Header} from './Components.js'

import './main.css';

var menuList = ["Strona Główna", "Dotychczasowe Imprezy", "Cennik", "O Mnie"];

function App() {
  return (
    <div className="app">
      <Header>Jarosław Kalinowski</Header>
      <MenuContainer menuList={menuList}/>
    </div>
  );
}

export default App;
